import styled from 'styled-components';


const NavStyle = styled.div`
    display:flex;
    justify-content: flex-end;
    padding-top:20px;
    padding-bottom:20px;
    margin-right:20px;  
    .nav{
        width:50%;
        display:flex;
        justify-content: space-between
    }
    .logo{
        width:8%;
        img{
            width:100%;
        }
    }

`;

export { NavStyle };
